import Layout from '../components/Layout'
import axios from 'axios'

class Index extends Component {

    static async getInitialProps() {
        const res = await axios.get("http://localhost:3001/blogs")
        .then(res => {
            console.log(res)
        })
        .catch(err => {
            console.error(err); 
        })

        return {res}
    }

    render() {
        return(
            <div>
                <Layout/>
            </div>
        )
    }
}

export default Index
